import React from "react";
import Header from "./Header.js";
import Home from "./Home.js";
import Home1 from "./Home1.js"
import  Component  from "./Component.js";
import  Component1  from "./Component1.js";

import Footer from "./Footer.js";



const Body = () =>{
    return(
        <>
       <Header />
       <Home />
       <Home1 />
      <Component />
      <Component1 />
       
       <Footer />
        </>
    )
}

export default Body;
